import React from "react";

function Navbar(props) {
  return (
    <nav className="navbar justify-content-between" style={{ padding: "0.9em 1em" }}>
      <a className="navbar-brand" href="../../">
        <span style={{fontSize: "1.3rem", letterSpacing: "2px"}}>CRYPT<i className="fab fa-bitcoin"></i>-Con</span>
      </a>
      <form className="form-inline">
        <input
          className="form-control mr-sm-2"
          type="search"
          placeholder="Search"
          aria-label="Search"
          onChange={props.searchCoin}
        />
      </form>
    </nav>
  );
}

export default Navbar;
